import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

const GIFS = [
  'https://media4.giphy.com/media/agLzP4BYRPcOY/giphy.gif?cid=ecf05e47jj0jzl67zs38oobb1ape8yxiiawer453io70ukrm&rid=giphy.gif&ct=g',
  'https://media1.giphy.com/media/naiatn5LxTOsU/giphy.gif?cid=ecf05e47nn4xf7so18yq2akg27h58cnmphispp6o5uiddjet&rid=giphy.gif&ct=g'
]

const DIFFERENT_GIFS = [
  'https://media4.giphy.com/media/XyU5bPERoI6DpRTNy7/giphy.gif?cid=ecf05e470i93ztsthv5hy1dlc3g5ji4694uh2eecou2vrie9&rid=giphy.gif&ct=g'
]

function App() {
  const [gifs, setGifs] = useState([GIFS])
  return (
    <div className="App">
      <section className="App-content">
        {
          gifs.map(singleGif => <img src={singleGif}/>)
        }
        <button onClick={() => setGifs(DIFFERENT_GIFS)}>Cambiar gifs</button>
      </section>
    </div>
  );
}

export default App;
